import React from 'react'

 function toggle(props) {
     console.log(props)
    return (
        <div>
             <button className="head-toggle" onClick={props.toggleClick}>
                <i className="fa fa-bars" aria-hidden="true" style={{color:'#fff'}}></i>
            </button>
        </div>
    )
}
export default toggle
